import React, { useState } from "react";
import { SafeAreaView, View, Text, TextInput, TouchableOpacity, StyleSheet, Image, Picker } from "react-native";
import { COLORS, SIZES, FONTS, icons } from "../constants";

const TopUp = ({ navigation }) => {
    const [depositAmount, setDepositAmount] = useState('');
    const [paymentAmount, setPaymentAmount] = useState('0.00');
    const [feeAmount, setFeeAmount] = useState('0.00');
    const [selectedAdmin, setSelectedAdmin] = useState('hau_admin');

    // Sample admins list
    const admins = [
        { label: 'HAU Finance Admin', value: 'hau_admin' },
        { label: 'Gcash', value: 'gcash' },
        { label: 'Paypal', value: 'paypal' },
    ];

    function renderHeader() {
        return (
            <View style={styles.header}>
                <TouchableOpacity
                    style={styles.iconButton}
                    onPress={() => navigation.goBack()}
                >
                    <Image
                        source={icons.back}
                        style={styles.icon}
                    />
                </TouchableOpacity>

                <View style={styles.titleContainer}>
                    <Text style={styles.title}>Top Up</Text>
                </View>

                <TouchableOpacity
                    style={styles.iconButton}
                    onPress={() => console.log("Settings")}
                >
                    <Image
                        source={icons.settings}
                        style={styles.icon}
                    />
                </TouchableOpacity>
            </View>
        );
    }

    function renderTopUpForm() {
        const feePercentage = 0.05; // Example fee percentage

        return (
            <View style={styles.formContainer}>
                <Text style={styles.formTitle}>Top-Up Money</Text>
                
                {/* Dropdown for selecting finance admin */}
                <View style={styles.dropdownContainer}>
                    <Picker
                        selectedValue={selectedAdmin}
                        onValueChange={(itemValue) => setSelectedAdmin(itemValue)}
                        style={styles.dropdown}
                    >
                        {admins.map((admin) => (
                            <Picker.Item key={admin.value} label={admin.label} value={admin.value} />
                        ))}
                    </Picker>
                </View>

                <TextInput
                    style={styles.input}
                    placeholder="0.00"
                    keyboardType="numeric"
                    value={depositAmount}
                    onChangeText={text => {
                        const amount = parseFloat(text) || 0;
                        const fee = amount * feePercentage;
                        setDepositAmount(text);
                        setFeeAmount(fee.toFixed(2));
                        setPaymentAmount((amount + fee).toFixed(2));
                    }}
                />

                <View style={styles.amountContainer}>
                    <View>
                        <Text style={styles.amountLabel}>Fee:</Text>
                        <Text style={styles.amountLabel}>Total Amount to Pay:</Text>
                    </View>
                    <View>
                        <Text style={styles.amountValue}>₱{feeAmount || "0.00"}</Text>
                        <Text style={styles.amountValue}>₱{paymentAmount || "0.00"}</Text>
                    </View>
                </View>
                
                <TouchableOpacity
                    style={styles.button}
                    onPress={() => console.log("Submit Top-Up")}
                >
                    <Text style={styles.buttonText}>Pay</Text>
                </TouchableOpacity>
            </View>
        );
    }

    return (
        <SafeAreaView style={styles.container}>
            {renderHeader()}
            {renderTopUpForm()}
        </SafeAreaView>
    );
};

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: COLORS.white,
    },
    header: {
        flexDirection: 'row',
        marginVertical: SIZES.padding * 4,
        paddingHorizontal: SIZES.padding * 3,
        alignItems: 'center',
    },
    iconButton: {
        width: 45,
        alignItems: 'center',
        justifyContent: 'center',
    },
    icon: {
        height: 20,
        width: 20,
        tintColor: COLORS.black,
    },
    titleContainer: {
        flex: 1,
        alignItems: 'center',
        justifyContent: 'center',
    },
    title: {
        color: COLORS.black,
        ...FONTS.h3,
    },
    formContainer: {
        flex: 1,
        paddingHorizontal: SIZES.padding * 3,
    },
    formTitle: {
        ...FONTS.h3,
        color: COLORS.black,
        marginBottom: SIZES.padding * 2,
    },
    input: {
        height: 50,
        borderColor: COLORS.gray,
        borderWidth: 1,
        borderRadius: 10,
        marginBottom: SIZES.base,
        paddingHorizontal: SIZES.padding,
        fontSize: SIZES.body3,
        color: COLORS.black,
    },
    dropdownContainer: {
        marginBottom: SIZES.base,
        borderWidth: 1,
        borderColor: COLORS.gray,
        borderRadius: 10,
        overflow: 'hidden',
    },
    dropdown: {
        height: 50,
        width: '100%',
        color: COLORS.black,
    },
    amountContainer: {
        flexDirection: 'row',
        alignItems: 'center',
        justifyContent: 'space-between',
        marginVertical: SIZES.base,
        padding: SIZES.padding,
        borderRadius: 10,
        backgroundColor: COLORS.lightGray,
        shadowColor: "#000",
        shadowOffset: { width: 0, height: 3 },
        shadowOpacity: 0.27,
        shadowRadius: 4.65,
        elevation: 6,
    },
    amountLabel: {
        ...FONTS.body4,
        color: COLORS.gray,
    },
    amountValue: {
        ...FONTS.h4,
        color: COLORS.primary,
    },
    button: {
        backgroundColor: COLORS.primary,
        paddingVertical: SIZES.base,
        borderRadius: 10,
        alignItems: 'center',
    },
    buttonText: {
        color: COLORS.white,
        ...FONTS.h4,
    },
});

export default TopUp;
